import React from 'react';
import '../../App.css';

export default function SignUp() {
  return (
    <div className='central'>
        <div className='option'>
          <div className='login'>LOGIN</div>
          <div className='sign-up'>SIGN-UP</div>
        </div>
    </div>
  );
}
